import React, { useState } from "react";
const Login = () => {
  const [user, setUser] = useState({
    email: "",
    password: "",
  });
  const [email, password] = user;
  const submit = () => {
    console.log("submit called");
    try {
      if (email === "" && password === "") {
        //TODO alert send
        console.log("Please Fill both field");
      } else {
      }
    } catch (error) {
      //TODO
    }
  };
  return (
    <div className="container">
      <div className="row mt-5 ms-5" style={{ height: "70vh" }}>
        <div className="col-4 border border-4 mt-3">Full Image</div>
        <div className="col-7 border border-4 mt-3">
          <h2 className="text-center">Login</h2>
          <div className="row">
            <section className="d-flex justify-content-evenly pt-2">
              <a href="!#">
                <i
                  className="fab fa-google fa-3x"
                  style={{ color: "grey" }}
                ></i>
              </a>
              <a href="!#">
                <i
                  className="fab fa-facebook fa-3x"
                  style={{ color: "grey" }}
                ></i>
              </a>
            </section>
          </div>
          <form className="pt-4" onSubmit={submit}>
            <div className="mb-3">
              <label for="inputEmail" className="form-label">
                Email address
              </label>
              <input
                type="email"
                className="form-control"
                id="inputEmail"
                aria-describedby="emailHelp"
              />
            </div>
            <div className="mb-3">
              <label for="inputPassword" className="form-label">
                Password
              </label>
              <input
                type="password"
                className="form-control"
                id="inputPassword"
                minLength="6"
              />
            </div>
            <button type="submit" class="btn btn-primary">
              Submit
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};
export default Login;
